import { Vue } from 'vue-property-decorator';
export default Vue.extend({
    components: {},
    props: {
        value: {
            type: [String, Date],
            default: null
        },
        max: {
            type: [String, Date],
            default: null
        },
        min: {
            type: [String, Date],
            default: null
        },
        clearable: {
            type: Boolean,
            default: false
        },
        formatInput: {
            type: String,
            default: 'hh:mm'
        },
        errorMessages: {
            default: null
        },
        appendIcon: {
            type: String,
            default: null
        },
        prependIcon: {
            type: String,
            default: null
        },
        disabled: {
            type: Boolean,
            default: false
        },
        hideDetails: {
            type: Boolean,
            default: false
        },
        label: {
            type: String,
            default: ''
        },
    },
    data() {
        return {
            menu: false,
            time: '',
            valueMax: undefined,
            valueMin: undefined
        }
    },
    computed: {
    },
    watch: {
        time(val, oldVal) {
            this.$emit('input', val);
        }
    },
    created() {
        if (this.value != null && this.value != undefined) {
            this.time = this.$moment(this.value, this.formatInput).format("k:mm");
        }
        if (this.max != null) {
            this.valueMax = this.$moment(this.max, this.formatInput).format("k:mm");
        }
        if (this.min != null) {
            this.valueMin = this.$moment(this.min, this.formatInput).format("k:mm");
        }
    },
    methods: {
        input(val: any) {
            this.$emit('input', val);
        }
    }
});
